import React, { Component } from 'react';
import { render } from 'react-dom';
import { Link,withRouter } from 'react-router-dom';
import Web3 from 'web3';
import './App.css';


const exams=[{papercode:'eng_9_2020',class:9,duration:'9am to 12pm',start:new Date(2020,12,5,9,0,0),end:new Date(2020,12,5,12,0,0),subject:"English"},
{papercode:'math_9_2020',class:9,duration:'1pm to 4pm',start:new Date(2020,12,5,1,0,0),end:new Date(2020,12,5,4,0,0),subject:"Math"}]
class center extends Component{


getpaper(id)
{
    var d= document.getElementById(id+'msg');
    document.getElementById(d).style.display="block";
    date=new Date();
    if(Math.abs(exam.start-date)<=3600000)
    {
        return <h1>Hello</h1>;
    }
    else
    {
        return <h2>HI</h2>;
    }

}
render() {


    return (


<div>
      <div class="container">          
      <center><h1 class="mt-4 pt-4" style={{position:"relative",top:-50}}>Today's Exams</h1></center>
      <div classname="exams">
   {exams.map((exam,index)=>(
     <div key={index}>
<div class="card bg-light">
      <div class="card-body">

      <button onClick={getpaper(this.id)} id={exam.papercode} class="btn btn-success float-right" style={{borderRadius: 20, height: 40,width:225, marginTop: 6}} >Get paper</button>

       <div id={exams.papercode+'msg'} style={{display:"none"}}>

           </div>

   <div class="h5 d-inline"><b>Subject:</b>&nbsp;&nbsp;{exam.subject}</div>
        <div class="h5"><b>Paper code:</b>&nbsp;&nbsp;{exam.papercode}</div>
        <div class="h5"><b>Duration:</b>&nbsp;&nbsp;{exam.duration}</div>
        <div class="h5"><b>Class:</b>&nbsp;&nbsp;{exam.class}</div>

      </div>
    </div>
     </div>
   ))}

    </div>
  </div>
  <div class="buttonRight">

      <button type="button" id="atb" class="btn btn-success  " onClick={this.addteacher} >
        <b>Add teacher</b>&nbsp;
      <i class="fa fa-plus" aria-hidden="true" ></i>

      </button>
      <div class="form-popup" id="center" style={{display:'none'}}>
        <form method="GET" id="centerform" class="form-container" onSubmit={this.confirmteacher} >

          <label for="name"><b>Name</b></label>
          <input type="text" placeholder="Enter name" name="name" required />
          <br></br>
          <label for="sub"><b>Subject</b></label>
          <input type="text" placeholder="Enter subject" name="sub" required/>
          <br></br>
          <label for="sid"><b>SubjectID</b></label>
          <input type="text" placeholder="Enter Subject ID" name="sid" required/>
          <button type="submit" class="btn">Submit</button>
          <button type="button" class="btn cancel">Close</button>
        </form>
      </div>
    </div>
    </div>
    );
  }
}

export default withRouter(exams);
